    // \uC5D0\uC14B\uC744 \uCCAD\uD06C\uBCC4\uB85C \uADF8\uB8F9\uD654\n    groupAssetsByChunk: true,\n\n    // \uC5D0\uC14B\uC744 \uC815\uBCF4\uBCC4\uB85C \uADF8\uB8F9\uD654 (immutable, development, hmr \uB4F1)\n    groupAssetsByInfo: true,\n\n    // \uAD00\uB828 \uC5D0\uC14B \uC815\uBCF4 \uD3EC\uD568 (sourcemap, compressed version \uB4F1)\n    relatedAssets: true,\n\n    // \uD37C\uD3EC\uBA3C\uC2A4 \uD78C\uD2B8 \uD3EC\uD568\n    performance: true,\n\n    // \uC5D4\uD2B8\uB9AC\uD3EC\uC778\uD2B8 \uD3EC\uD568\n    entrypoints: true,\n\n    // namedChunkGroups \uC5D0 \uB300\uD55C \uC815\uBCF4 \uD3EC\uD568\n    chunkGroups: true,\n\n    /* \uACE0\uAE09 \uCCAD\uD06C \uADF8\uB8F9 \uC124\uC815 */\n    // \uC5D4\uD2B8\uB9AC\uD3EC\uC778\uD2B8, \uCCAD\uD06C \uADF8\uB8F9\uC5D0 \uB300\uD574 \uBCF4\uC870 \uC5D0\uC14B \uD3EC\uD568\n    chunkGroupAuxiliary: true,\n\n    // \uD558\uC704 \uCCAD\uD06C \uADF8\uB8F9 \uD3EC\uD568 (prefetched, preloaded)\n    chunkGroupChildren: true,\n\n    // \uCCAD\uD06C \uADF8\uB8F9 \uC5D0\uC14B \uBAA9\uB85D \uC81C\uD55C\n    chunkGroupMaxAssets: 5,\n\n    // \uCCAD\uD06C \uBAA9\uB85D \uD45C\uC2DC\n    chunks: true,\n\n    /* \uACE0\uAE09 \uCCAD\uD06C \uC124\uC815 */\n    // \uCCAD\uD06C \uC815\uB82C \uC124\uC815\n    chunksSort: "id",\n\n    // \uBE4C\uB4DC\uB41C \uBAA8\uB4C8\uC5D0 \uB300\uD55C \uC815\uBCF4\uB97C \uCCAD\uD06C\uC5D0 \uD3EC\uD568\n    chunkModules: true,\n\n    // \uCCAD\uD06C \uCD9C\uCC98 \uD3EC\uD568\n    chunkOrigins: true,\n\n    // \uCCAD\uD06C \uAD00\uACC4 \uD3EC\uD568 (parents, children, sibilings)\n    chunkRelations: true,\n\n    // \uCCAD\uD06C \uC885\uC18D\uC131 \uD3EC\uD568\n    dependentModules: true,\n\n    // \uBAA8\uB4C8 \uBAA9\uB85D \uD45C\uC2DC\n    modules: true,\n\n    /* \uACE0\uAE09 \uBAA8\uB4C8 \uC124\uC815 */\n    // \uD45C\uC2DC\uB420 \uBAA8\uB4C8 \uB77C\uC778\n    modulesSpace: 15,\n\n    // \uC911\uCCA9 \uBAA8\uB4C8 \uD3EC\uD568\n    nestedModules: true,\n\n    // \uCE90\uC2DC\uB41C \uBAA8\uB4C8 \uD3EC\uD568\n    cachedModules: true,\n\n    // \uCD5C\uC801\uD654 \uADF8\uB798\uD504\uC5D0\uC11C \uCC38\uC870\uB418\uC9C0 \uC54A\uB294 \uBAA8\uB4C8 \uD3EC\uD568\n    orphanModules: false,\n\n    // \uC81C\uC678\uD560 \uBAA8\uB4C8 \uACBD\uB85C\n    excludeModules: false, // string | RegExp | (assetName) => boolean\n\n    // \uBAA8\uB4C8\uC774 \uD3EC\uD568\uB41C \uC774\uC720 \uCD94\uAC00\n    reasons: true,\n\n    // \uBAA8\uB4C8\uC758 \uC18C\uC2A4\uCF54\uB4DC \uD3EC\uD568\n    source: false,\n\n    /* \uC804\uBB38\uAC00\uC6A9 \uBAA8\uB4C8 \uC124\uC815 */\n    // \uBAA8\uB4C8 \uC815\uB82C \uC124\uC815\n    modulesSort: "id",\n\n    // \uBAA8\uB4C8\uC744 \uACBD\uB85C\uBCC4\uB85C \uADF8\uB8F9\uD654\n    groupModulesByPath: true,\n\n    // \uBAA8\uB4C8\uC744 \uD655\uC7A5\uC790\uBCC4\uB85C \uADF8\uB8F9\uD654\n    groupModulesByExtension: true,\n\n    // \uBAA8\uB4C8\uC744 \uC18D\uC131\uBCC4\uB85C \uADF8\uB8F9\uD654 (errors, wanings, assets, optional, orphan, dependent)\n    groupModulesByAttributes: true,\n\n    // \uBAA8\uB4C8\uC744 \uCE90\uC2DC \uC0C1\uD0DC\uBCC4\uB85C \uADF8\uB8F9\uD654\n    groupModulesByCacheStatus: true,\n\n    // \uAC01 \uC5D4\uD2B8\uB9AC\uC5D0\uC11C\uC758 depth \uD3EC\uD568\n    depth: false,\n\n    // \uBAA8\uB4C8 \uB0B4 \uC5D0\uC14B\uC5D0 \uB300\uD55C \uC815\uBCF4 \uD3EC\uD568\n    moduleAssets: true,\n\n    // \uB7F0\uD0C0\uC784 \uBAA8\uB4C8\uC5D0 \uB300\uD55C \uC815\uBCF4 \uD3EC\uD568\n    runtimeModules: true,\n\n    /* \uACE0\uAE09 \uCD5C\uC801\uD654 \uC124\uC815 */\n    // \uBAA8\uB4C8 exports \uD3EC\uD568\n    providedExports: false,\n\n    // \uC0AC\uC6A9\uB418\uB294 \uBAA8\uB4C8\uC758 exports \uD3EC\uD568\n    usedExports: false,\n\n    // bailout \uC0AC\uC720 \uD3EC\uD568\n    // https://webpack.js.org/plugins/module-concatenation-plugin/\n    optimizationBailout: false,\n\n    // chilren \uC815\uBCF4 \uD3EC\uD568\n    children: true,\n\n    // \uB85C\uADF8 \uB808\uBCA8\n    logging: true,\n\n    // \uD2B9\uC815 \uB85C\uAC70\uC758 \uB514\uBC84\uA